import styled from "styled-components";
import { colors, rawColors } from "../locales/colors";

export const InputBase = styled.input`
  color: ${rawColors.white_700};
  display: flex;
  width: 160px;
  height: 20px;
  border-radius: 10px;
  border-width: 1px;
  ::placeholder ;
`;
